import React from "react";
import './navigation-list.css'
import NavItem from '../navigation-item'

const NavList=()=>{
    return(
        <div>
        <NavItem label="Ноутбуки"/>
        <NavItem label="Смартфони"/>
        <NavItem label="Товари для дому"/>
        <NavItem label="Товари для геймерiв"/>
        </div>
    )
}
export default NavList
